import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Injections() {
  const [injections, setInjections] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const response = await axios.get('/api/injections');
      setInjections(response.data);
    }
    fetchData();
  }, []);

  return (
    <div>
      <h1>Medical Injections</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Timestamp</th>
            <th>Type</th>
            <th>Dose</th>
            <th>User ID</th>
          </tr>
        </thead>
        <tbody>
          {injections.map(injection => (
            <tr key={injection.id}>
              <td>{injection.id}</td>
              <td>{injection.timestamp}</td>
              <td>{injection.type}</td>
              <td>{injection.dose}</td>
              <td>{injection.user_id}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Injections;
